import React from "react";
import ReactDOM from "react-dom";

const Header = (props) => {
  return <h1>{props.course}</h1>;
};

const Content = (props) => {
  return (
    <>
      <Part name={props.part1Name} ex={props.part1Ex}></Part>
      <Part name={props.part2Name} ex={props.part2Ex}></Part>
      <Part name={props.part3Name} ex={props.part3Ex}></Part>{" "}
    </>
  );
};
const Part = (props) => {
  <div>{props.name}</div>;
};
const Total = (props) => {
  return <>Total number of excercises: {props.e1 + props.e2 + props.e3}</>;
};
const App = () => {
  const course = "Half Stack application development";
  const part1 = "Fundamentals of React";
  const exercises1 = 10;
  const part2 = "Using props to pass data";
  const exercises2 = 7;
  const part3 = "State of a component";
  const exercises3 = 14;

  return (
    <div>
      <Header course={course} />
      <p>
        <Content part1Name={part1} part1Ex={exercises1} />{" "}
      </p>{" "}
      <p>
        <Content part2Name={part2} part2Ex={exercises2} />
      </p>
      <p>
        <Content part3Name={part3} part3Ex={exercises3} />
      </p>{" "}
      <p>
        <Total e1={exercises1} e2={exercises3} e3={exercises2}></Total>
      </p>
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
